3.- N’entrent dans les n°s 39.01 à 39.11 que les produits obtenus par voie de synthèse chimique
et relevant des catégories ci-après :
a) les polyoléfines synthétiques liquides dont moins de 60% en volume distillent à 300 °C
rapportés à 1.013 millibars par application d’une méthode de distillation à basse pression
(n°s 39.01 et 39.02);
b) les résines faiblement polymérisées du type coumarone-indène (n° 39.11);
c) les autres polymères synthétiques comportant au moins 5 motifs monomères, en
moyenne; 
d) les silicones (n° 39.10);
e) les résols (n° 39.09) et les autres prépolymères.
4.- On entend par copolymères tous les polymères dans lesquels la part d’aucun motif
monomère ne représente 95 % ou davantage en poids de la teneur totale du polymère.
Sauf dispositions contraires, au sens du présent Chapitre, les copolymères (y compris
les copolycondensats, les produits de copolyaddition, les copolymères en bloc et les
copolymères greffés) et les mélanges de polymères relèvent de la position couvrant les
polymères du motif comonomère qui prédomine en poids sur tout autre motif comonomère
simple. Au sens de la présente Note, les motifs comonomères constitutifs de polymères qui
relèvent d’une même position doivent être pris ensemble.
